import React from "react";
import { useNavigate } from "react-router-dom";
import { ReactComponent as IconKakako } from "./assets/카카오로그인.svg";
import { useGlobalState } from "./GlobalState";
import "./styles/LoginSlider.css";

function LoginSlider({ slides = [] }) {
    const { dispatch } = useGlobalState();
    const navigate = useNavigate(); // useNavigate hook from react-router-dom

    const handleLoginClick = () => {
        navigate("/game"); // Navigate to /game
    };

    return (
        <div className="screen">
                <img className="image" alt="Image" src="image 1667.svg"/>
                <div className="text-wrapper">재미있게</div>
                <div className="div">건강하게</div>
                <div className="text-wrapper-2">오래오래</div>
                <div className="text-wrapper-3">시니어스</div>

            <div className="kakao-login-button">

                <div className="kakao-login-content" onClick={handleLoginClick}>
                    <IconKakako className="kakao-login-icon" alt="Kakao Icon"/>
                    <div className="kakao-login-text">
                        카카오톡 로그인하기
                    </div>
                </div>
            </div>
        </div>
    );
}

export default LoginSlider;
